import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { SidenaComponent } from './components/sidena/sidena.component';
import { MaterialModule } from './material.module';
import { FlexLayoutModule } from '@angular/flex-layout';
import { RouterModule } from '@angular/router';
import { HttpClientModule } from '@angular/common/http';
import { ConfirmComponent } from './components/confirm/confirm.component';
import { DetailFilesComponent } from './components/detailsfiles/detailsfiles.component';
import { NewCategoryComponent } from '../category/components/new-category/new-category.component';



@NgModule({
  declarations: [
    SidenaComponent,
    ConfirmComponent,
    DetailFilesComponent,
    NewCategoryComponent
  ],
  exports: [
    SidenaComponent
  ]
  ,
  imports: [
    CommonModule,
    RouterModule,
    MaterialModule,
    FlexLayoutModule,
    HttpClientModule
  ]
})
export class SharedModule { }
